import React, {useState, useEffect} from 'react';
import CSGO from './Images/CSGO.png';
import './Games.css';
import axios from 'axios';


function Games(props) {
    const [data, setData] = useState([]);
    var gamesArray;
    var reviewsArray;
    var pricesArray;

    const fetchAPI = async() => {
      var GameOne;
      var GameTwo;
      var GameThree;
      const response = await axios.get("http://127.0.0.1:8080/api/members");
      setData(response.data.games);
      console.log(response.data.games)
      for (let key in response.data.games){
        GameOne.push(response.data.games[key]);
      }
      console.log(GameOne);
    };


    //Somewhere around here we need to parse through the strings,
    //remove quotes whenever we find them (as well as []'s), but also
    //use quotes as identifiers for the beginning and end of a string to use.
    

  
    useEffect(() => {
      fetchAPI()
    }, []);

  return (
    <div className = "games">
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>Title</p>
                <span>{gamesArray}</span>
            </div>
            <div className = "Games-Middle">
                <p>Steam Rating</p>
            </div>
            <div className = "Games-Middle">
                <p> Price</p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">
                        
                    </button>
                </div>
            </div>
        </div>
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>Title</p>
            </div>
            <div className = "Games-Middle">
                <p>Steam Rating</p>
            </div>
            <div className = "Games-Middle">
                <p> Price</p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">
                        
                    </button>
                </div>
            </div>
        </div>
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>Title</p>
            </div>
            <div className = "Games-Middle">
                <p>Steam Rating</p>
            </div>
            <div className = "Games-Middle">
                <p> Price</p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">

                    </button>
                </div>
            </div>
        </div>
    </div>
  );
}

export default Games;
